import React from 'react';
import { NavLink } from 'react-router-dom';

export default function Header() {
  const logo = require('../assets/img/home/Logo.png');
  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <div className="logo">
            <img src={logo} alt="Logo" className="logo-img" />
          </div>
          <nav className="nav">
            <NavLink to="/" end className={({ isActive }) => (isActive ? 'nav-link active' : 'nav-link')}>Home</NavLink>
            <NavLink to="/about" className={({ isActive }) => (isActive ? 'nav-link active' : 'nav-link')}>About</NavLink>
            <NavLink to="/blog" className={({ isActive }) => (isActive ? 'nav-link active' : 'nav-link')}>Blog</NavLink>
            <NavLink to="/pricing" className={({ isActive }) => (isActive ? 'nav-link active' : 'nav-link')}>Pricing</NavLink>
            <NavLink to="/contact" className={({ isActive }) => (isActive ? 'nav-link active contact-link' : 'nav-link contact-link')}>Contact Us â†’
              <span className="nav-line" aria-hidden="true"></span>
            </NavLink>
          </nav>
        </div>
      </div>
    </header>
  );
}
